import React, { useEffect, useState } from 'react';
import tpab from '../assets/topimpabutterfly.png'
import Sidebar from './sidebar';
import Stack from '@mui/material/Stack';


import '../styles/homeView.css';

export default function HomeView() {
  return (
    <div className="homeView">
      <Sidebar></Sidebar>
      <Stack spacing={0} direction="column">

        <div className='home'>
        <Stack spacing={0} direction="column">
         <img src={tpab} className='tpab'></img>
         <h1 className='txtaccueil'>Notez les albums que vous avez écouté
          <br></br> Gardez pour plus tard ceux qui vous intéressent
         </h1>
         </Stack>
        </div>

        <div className='footer'>
          <p>Musicboxd. Application créée par un <a href='https://www.linkedin.com/in/tom-philippe-214a9a224/' className='lien'>étudiant français</a>. Données : <a href='https://deezer.com' className='lien'>Deezer </a></p>
        </div>

      </Stack>
    </div>
  );
}
